Here's a simple "Hello World" program in C++:

```cpp
#include <iostream>

int main() {
    std::cout << "Hello, World!" << std::endl;
    return 0;
}
```

To compile and run this code, you'll need to have C++ installed on your system. Here are the steps:

1. Save the code in a file with a `.cpp` extension (e.g., `hello.cpp`)
2. Open a terminal or command prompt
3. Compile the code using a C++ compiler (e.g., `g++ hello.cpp -o hello`)
4. Run the compiled program using `./hello`

Alternatively, you can use an IDE like Visual Studio Code with the C++ extension to write and run your code directly.

Note: The `-o` option tells the compiler to output the executable file name as "hello".

To solve the 2 Sum problem, here's an example of how you can write it in Go:

```go
package main

import (
    "fmt"
    "sort"
)

func twoSum(nums []int, target int) (int, int) {
    map := make(map[int]int)
    for i, num := range nums {
        complement := target - num
        if val, ok := map[complement]; ok {
            return val + 1, i + 1
        }
        map[num] = i
    }
    return -1, -1 // not found
}

func main() {
    nums := []int{2, 7, 11, 15}
    target := 9
    result := twoSum(nums, target)
    fmt.Println(result) // Output: (0, 1)
}
```

In this example, we use a map to store the numbers in the `nums` array as keys and their indices as values. Then, for each number in the array, we check if its complement (i.e., the difference between the target and the current number) is already in the map. If it is, we return the index of the complement and the index of the current number plus one.

Note that this solution has a time complexity of O(n), where n is the length of the `nums` array.
